window.bookSummaryJSON = "<p>We're the D'Artigo sisters: savvy half-human, half-Fae operatives for the Otherworld Intelligence Agency. My sister Camille is the Queen of Dusk &amp; Twilight and married to three hunky men. Menolly is a vampire married to a gorgeous werepuma and a vampire prince. And me? I'm Delilah, a Death Maiden werecat, and I'm about to marry the love of my life. </p> <p>But in the midst of joy, we are facing the escalating war with Shadow Wing. About to attempt one of the most dangerous acts we've ever considered, can we keep the demon armies at bay while luring the demon lord into one final, coordinated attack?</p> <p>My wedding day to Shade arrives, and somebody invited Murphy's Law along to the ceremony. But the chaos only extends from there. Camille and her Keraastar Knights are finally united and ready. Menolly and Roman are aligning the vampires. And the dragons have pledged their help as the final battle with Shadow Wing draws near. But best-laid plans go awry. As our plans fall apart, we must align ourselves with Trytian and the daemons. Will they be able to help us corner Shadow Wing when several of the portals fail and demons begin pouring into Seattle? Or are we too late, and will Shadow Wing manage to break through, even without the help of the spirit seals?</p>"; 
